import React from 'react';
import {Text} from 'react-native';
import {Input} from 'react-native-elements';
import Icon from 'react-native-vector-icons/FontAwesome';

export default function LoginForm(){

    return(
        <Input
            placeholder='Username'
            leftIcon={
                <Icon
                    name='user'
                    size={24}
                    color='black'
                />
            }
        />

    )
}
